ControlPropertyState.AutoRuleBindingString:
UpdateContext(
    {
        init: false,
        spinnerLabelForEditSettings: DVAssessmentPageLoc.scanningAllRolesText
    }
);

Environment.cat_ScanAllRoles();

UpdateContext(
    {
        init: true,
        spinnerLabelForEditSettings: ""
    }
);
If(
    CountRows(RetrieveAssessableSecurityRoles) > 0,
    Notify(
        DVAssessmentPageLoc.scanRoleNotificationText,
        NotificationType.Information,
        5000
    );
    ,
    true
);
ClearCollect(
    col_RiskAssessmentToBeDisplayed,
    RisksAssessmentsToBeDisplayed
);

UpdateContext({
    init:false,
    spinnerLabelForEditSettings:"Enabling auto scan"
});

With(
    {
        s: "msdyn_DVAcceleratorAutoScan",
        v: "yes"
    },
    If(
        IsBlankOrError(AutoScanEnvVar),
        Patch(
            [@'Environment Variable Values'],
            Defaults([@'Environment Variable Values']),
            {
                'Environment Variable Definition': LookUp(
                    'Environment Variable Definitions',
                    'Schema Name' = s
                ),
                'Schema Name': s,
                Value: v
            }
        ),
        Patch(
            [@'Environment Variable Values'],
            AutoScanEnvVar,
            {
                'Schema Name': s,
                Value: v
            }
        )
    )
);


UpdateContext({
    init:true,
    spinnerLabelForEditSettings:Blank()
});

UpdateContext({
    init:false,
    spinnerLabelForEditSettings:"Disabling auto scan"
});


With(
    {
        s: "msdyn_DVAcceleratorAutoScan",
        v: "no"
    },
    If(
        IsBlankOrError(AutoScanEnvVar),
        Patch(
            [@'Environment Variable Values'],
            Defaults([@'Environment Variable Values']),
            {
                'Environment Variable Definition': LookUp(
                    'Environment Variable Definitions',
                    'Schema Name' = s
                ),
                'Schema Name': s,
                Value: v
            }
        ),
        Patch(
            [@'Environment Variable Values'],
            AutoScanEnvVar,
            {
                'Schema Name': s,
                Value: v
            }
        )
    )
);

UpdateContext({
    init:true,
    spinnerLabelForEditSettings:Blank()
});
